import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (


    <div className="App">
      <header className="App-header">
        <img src="/documents/github/19_20_TWOIng4_Project/frontend/src/4.png" className="App-logo" alt="oooh" />
        <p>

          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
  );
}

export default App;
